import App from "../App";

export default function Header (props) {
    console.log(props);
    return(
        <div>
            <h4>{props.wel}</h4>
            <h2>{props.header.welcome}</h2>
            <h3>{props.header.title}</h3>
            <p>{props.header.subtitle}</p>
        </div>

    );
};
